import React from 'react';

const Contact = ({ contact, deleteContact }) => {
    const handleDelete = () => {
        deleteContact(contact.id);
    };

    return (
        <tr>
            <td>{contact.firstName}</td>
            <td>{contact.lastName}</td>
            <td>{contact.phone}</td>
            <td><button onClick={handleDelete}>Delete</button></td>
        </tr>
    );
};

export default Contact;
